'use strict';
/**
 * Optical Character Recognition Library via ABBYY (http://ocrsdk.com/)
 * @author Leo Mylonas
  */
WMAPP.module('Extension.OCR', function(OCR) {

	OCR.ApplicationName = 'WorkingMouse';
	OCR.ApplicationPassword = 'dmsjxwTWP87D4VgaIg+KARGx';
	OCR.ApiUrlRoot = 'https://cloud.ocrsdk.com/';

	OCR.Initialize = function(applicationName, applicationPassword) {
		OCR.ApplicationName = applicationName ? applicationName : OCR.ApplicationName;
		OCR.ApplicationPassword = applicationPassword ? applicationPassword : OCR.ApplicationPassword;
	};

	OCR.GetTaskStatus = function(taskId) {
		return $.ajax({
			url: 'https://dev.crowdsites.com/feature/core/core/ocr/getTaskStatus/' + taskId,
			headers: {
				"Accept": "application/json",
			},
			type: 'GET'
		});
	};

	OCR.WaitForCompletedTask = function(taskId) {
		var promise = new $.Deferred();

		var getTaskStatus = function(response) {
			if (response && response.status == "Completed") {
				promise.resolveWith(promise, arguments);
			} else {
				OCR.GetTaskStatus(taskId).then(getTaskStatus, function() {
					promise.rejectWith(promise, arguments);
				});
			}
		};

		getTaskStatus();

		return promise;
	};

	OCR.ScanBusinessCard = function(img) {
		var promise = new $.Deferred();

		var error = function() {
			WMAPP.Helper.hideSpinner();
			WMAPP.Helper.hideStatus();
			promise.rejectWith(promise, arguments);
		}

		if (img) {
			WMAPP.Helper.showSpinner();
			WMAPP.Helper.showStatus('Uploading business card');

			var formData = new FormData();
			formData.append('file', img);

			$.ajax({
				url: 'https://dev.crowdsites.com/feature/core/core/ocr/processBusinessCard',
				data: formData,
				processData: false,
				contentType: false,
				type: 'POST',
				headers: {
					"Accept": "application/json",
				},
				beforeSend: function(jqXhr, xhr) {
					xhr.xhr = function() {
						var xhr = new window.XMLHttpRequest();
						xhr.upload.addEventListener("progress", WMAPP.xhrUploadProgressHandler, false);
						xhr.addEventListener("progress", WMAPP.xhrDownloadProgressHandler, false);
						return xhr;
					}
				},
			}).then(function(response) {
				if (response.id) {
					WMAPP.Helper.showStatus('Performing OCR...');
					OCR.WaitForCompletedTask(response.id).then(function(task) {
						WMAPP.Helper.hideSpinner();
						WMAPP.Helper.hideStatus();
						promise.resolveWith(promise, [task.businessCard]);
					}, error);
				} else {
					error("Failed to retreive TaskId from processBusinessCard API call.");
				}
			}, error);
		} else {
			error("No image provided");
		}

		return promise;
	};

	OCR.test = function() {
		// data:image/tiff;base64,

		var imgData = "";
		var img = WMAPP.Helper.base64ToBlob(imgData, 'image/tiff');

		console.log(img);


		OCR.ScanBusinessCard(img).then(function(businessCard) {
			console.log("done", businessCard);
		}, function(error) {
			console.error(error);
		});
	};
});
